"""# **Building a dashboard**

### **Top 10 Highest-Paid Employees**

Imagine you're a data analyst at PayrollDB3, tasked with identifying the top 10 highest-paid employees in the company. To achieve this, we've crafted an SQL query that calculates the total salary for each employee by summing their fixed components, allowances, and deducting applicable deductions. We prioritize showcasing the employees with the highest total earnings to provide insights into the organization's highest earners.

The code executes this query and extracts the top 10 highest-paid employees' data. Using Datapane, a table visualization is generated to present these results, offering a clear overview of the top earners and facilitating swift decision-making for human resources and management teams.
"""

import datapane as dp

Total_Salary = '''
SELECT
    e.Emp_Id,
    e.FName,
    e.LName,
    SUM(pi.Fixed_Component + COALESCE(a.Allowance_Amount, 0) - COALESCE(ed.Deduction_Amount, 0)) AS TotalSalary
FROM `PayrollDB3`.`Allowance` a
JOIN `PayrollDB3`.`Employee` e ON e.Emp_Id = a.Allowance_Emp_ID
JOIN `PayrollDB3`.`Emp_Deduction` ed ON e.Emp_deduction_Id = ed.Emp_deduction_Id
LEFT JOIN `PayrollDB3`.`Payroll_Item` pi ON e.Emp_Id = pi.payroll_Emp_Id
GROUP BY e.Emp_Id, e.FName, e.LName
ORDER BY TotalSalary DESC
LIMIT 10;
'''

# Execute the SQL query
top_10_df = run_query(Total_Salary)

# Display the top 10 results in a DataTable using Datapane
dp.DataTable(top_10_df)

"""### **Top 5 Employees' Salary Components in PayrollDB3 Database**

The following gives an overview of the top 5 highest-paid employees within the 'PayrollDB3' database. It calculates various salary components, including gross salary (comprising fixed components and allowances), total deductions, total allowances, and net salary (after accounting for deductions). By joining tables related to employees, allowances, deductions, and payroll items, the query focuses on analyzing and showcasing the compensation breakdown for the top earners, providing crucial insights into their salary structures.
"""

Highest_salary_distribution = """
SELECT
    e.Emp_Id,
    e.FName,
    e.LName,
    (pi.Fixed_Component + COALESCE(a.Allowance_Amount, 0)) AS GrossSalary,
    COALESCE(ed.Deduction_Amount, 0) AS TotalDeductions,
    COALESCE(a.Allowance_Amount, 0) AS TotalAllowance,
    (pi.Fixed_Component + COALESCE(a.Allowance_Amount, 0) - COALESCE(ed.Deduction_Amount, 0)) AS NetSalary
FROM
    `PayrollDB3`.`Employee` e
LEFT JOIN
    `PayrollDB3`.`Allowance` a ON e.Emp_Id = a.Allowance_Emp_ID
LEFT JOIN
    `PayrollDB3`.`Emp_Deduction` ed ON e.Emp_Deduction_Id = ed.Emp_Deduction_Id
LEFT JOIN
    `PayrollDB3`.`Payroll_Item` pi ON e.Emp_Id = pi.Payroll_Emp_Id
ORDER BY
    NetSalary DESC
LIMIT 5;

"""

run_query(Highest_salary_distribution )

