"""### **Data Table: Age Group-wise Deduction Summary**

The SQL query presented performs a detailed analysis within the 'PayrollDB3' database, summarizing deductions categorized by age groups. By segmenting ages into ranges ('20-30', '31-40', '41-50', '51-60', 'Other'), the query aggregates deduction types alongside their respective total deduction amounts for each age category. The resulting data table, visualized using Datapane, provides a comprehensive breakdown of deductions across distinct age groups. This insightful breakdown sheds light on deduction patterns among employees within different age brackets recorded in the database, enabling a nuanced understanding of deduction distribution among varying age demographics.
"""

import datapane as dp
query = """
SELECT
    Age_Group,
    Deduction_Type,
    SUM(Total_Deduction) AS Total_Deduction
FROM (
    SELECT
        CASE
            WHEN e.Age BETWEEN 20 AND 30 THEN '20-30'
            WHEN e.Age BETWEEN 31 AND 40 THEN '31-40'
            WHEN e.Age BETWEEN 41 AND 50 THEN '41-50'
            WHEN e.Age BETWEEN 51 AND 60 THEN '51-60'
            ELSE 'Other'
        END AS Age_Group,
        ed.Deduction_Type,
        SUM(ed.Deduction_Amount) AS Total_Deduction
    FROM PayrollDB3.Employee e
    LEFT JOIN PayrollDB3.Deduction d ON e.Emp_Id = d.Emp_Id
    LEFT JOIN PayrollDB3.Emp_Deduction ed ON d.Emp_Deduction_Id = ed.Emp_Deduction_Id
    GROUP BY Age_Group, ed.Deduction_Type
) AS Deduction_Summary
GROUP BY Age_Group, Deduction_Type
ORDER BY Age_Group ASC, Total_Deduction DESC;
"""

deduction_age_data = run_query(query)
dp.DataTable(deduction_age_data)

"""### **Stacked Bar Chart: Total Deduction by Deduction Type and Gender with Percentage Labels**

This code generates a stacked bar chart using Matplotlib based on provided 'pivot_data'. The chart visualizes the total deduction amounts categorized by deduction types and gender. Additionally, the code computes and incorporates percentage labels for each stack (group) within the bars, showcasing the proportion of each gender's contribution to the total deductions for various deduction types. This visualization method aids in understanding the relative contribution of different genders towards total deductions across different deduction types, enhancing insights into deduction distributions based on gender demographics within the dataset.
"""

import pandas as pd
import matplotlib.pyplot as plt

# Your SQL Query here
Gender_based_deduction = """
SELECT
    e.Gender,
    ed.Deduction_Type,  -- Ensure Deduction_Type column is included in the query
    SUM(ed.Deduction_Amount) AS Total_Deduction
FROM PayrollDB3.Employee e
LEFT JOIN PayrollDB3.Deduction d ON e.Emp_Id = d.Emp_Id
LEFT JOIN PayrollDB3.Emp_Deduction ed ON d.Emp_Deduction_Id = ed.Emp_Deduction_Id
GROUP BY e.Gender, ed.Deduction_Type;  -- Group by both Gender and Deduction_Type
"""

# Retrieve data from the database
data = run_query(Gender_based_deduction)

# Pivot the data for plotting
pivot_data = data.pivot(index='Deduction_Type', columns='Gender', values='Total_Deduction')

# Calculate percentages
totals = pivot_data.sum(axis=1)
percentage_data = pivot_data.div(totals, axis=0) * 100

# Plotting a stacked bar chart with percentage labels
ax = pivot_data.plot(kind='bar', stacked=True, figsize=(12, 8))

# Add percentage labels on each stack (group)
for i in range(len(pivot_data)):
    total_stack = pivot_data.iloc[i].sum()
    label_y = 0
    for j in range(len(pivot_data.columns)):
        percentage = round(percentage_data.iloc[i, j], 2)
        plt.text(i, label_y + (pivot_data.iloc[i, j] / 2), f"{percentage}%", ha='center', color='white')
        label_y += pivot_data.iloc[i, j]

plt.xlabel('Deduction Type')
plt.ylabel('Total Deduction')
plt.title('Total Deduction by Deduction Type and Gender (Stacked with Percentage)')
plt.legend(title='Gender')
plt.grid(axis='y')
plt.tight_layout()
plt.show()

"""### **Comparison of Average Salaries Across Departments**

The visualization illustrates the average salaries in different departments within the organization. Each horizontal bar represents a department, with the bar length indicating the average salary value. This visualization helps in comparing and understanding the variations in average salaries among various departments.
"""

import pandas as pd
import plotly.express as px

avg_salary_deptwise_query = """
SELECT D.Dept_Name AS Department, AVG(PI.Fixed_Component) AS Avg_Salary
FROM `PayrollDB3`.`Employee` E
LEFT JOIN `PayrollDB3`.`Department` D ON E.Emp_Dept_Id = D.Dept_Id
LEFT JOIN `PayrollDB3`.`Payroll_Item` PI ON E.Emp_Id = PI.Payroll_Emp_Id
GROUP BY D.Dept_Name;
"""

# Assuming 'run_query' function runs the SQL query and fetches the data into a DataFrame
avg_salary_deptwise = run_query(avg_salary_deptwise_query)

# Creating a horizontal bar chart using Plotly Express for average salary per department
fig = px.bar(
    avg_salary_deptwise,
    y="Department",
    x="Avg_Salary",
    text="Avg_Salary",
    title="Average Salary in Each Department",
    labels={"Avg_Salary": "Average Salary ($)"},
    orientation="h"
)

fig.update_traces(texttemplate="%{text:.2f}")  # Update the text display on the bars to two decimal places

fig.show()

"""### **Department-wise Average Salary Deviation from Organizational Mean: Insights and Disparities**

The analysis reveals variations in departmental average salaries compared to the organization's overall average. Positive percentages indicate higher-than-average salaries, while negative values signify lower-than-average pay within specific departments. This data highlights potential disparities in compensation across departments, suggesting areas for further review, potential performance-reward alignment, and guiding HR strategies for equity and fairness in salaries.
"""

import pandas as pd
import plotly.express as px

avg_salary_deptwise_query = """
SELECT D.Dept_Name AS Department, AVG(PI.Fixed_Component) AS Avg_Salary
FROM `PayrollDB3`.`Employee` E
LEFT JOIN `PayrollDB3`.`Department` D ON E.Emp_Dept_Id = D.Dept_Id
LEFT JOIN `PayrollDB3`.`Payroll_Item` PI ON E.Emp_Id = PI.Payroll_Emp_Id
GROUP BY D.Dept_Name;
"""

# Assuming 'run_query' function runs the SQL query and fetches the data into a DataFrame
avg_salary_deptwise = run_query(avg_salary_deptwise_query)

avg_salary_deptwise["difference_from_avg"] = (
    avg_salary_deptwise["Avg_Salary"] - avg_salary_deptwise["Avg_Salary"].mean()
) * 100.0

# Creating a bar chart using Plotly Express
fig = px.bar(
    avg_salary_deptwise,
    x="Department",
    y="difference_from_avg",
    color="Department",
    title="Average Salary - Percentage Difference from Mean",
    labels={"Department": "Department", "difference_from_avg": "Difference from Mean (%)"},
)

fig.update_layout(showlegend=False)  # Hiding the legend

fig.show()

